import React from 'react';

//import HeaderButtons from './Components/HeaderButtons';
//import HeaderTitle from './Components/ClickableDiv';
import circlePlaceholder from './Icons/circlePlaceholder.png';
//import ScrollButton from './Components/ScrollButton';

const SecondPage = () => (
  <div className='page' id='second-page'>
     {/* First Section: Image On top Right | Working Lady*/}
     <div className="second-page-girl-div">
      <img src = {circlePlaceholder} alt="Placeholder" className="first-page-girl-img" />
    </div>
  </div>
);

export default SecondPage;
